/*Table structure for table `account_hand_apply` */

DROP TABLE IF EXISTS `account_hand_apply`;

CREATE TABLE `account_hand_apply` (
  `ACCOUNT_HAND_APPLY_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '开户信息ID',
  `OPERATORID` int(11) DEFAULT NULL COMMENT '操作员ID',
  `OPERATORNAME` varchar(50) DEFAULT NULL COMMENT '操作员姓名',
  `PROVINCE` varchar(10) DEFAULT NULL COMMENT '省分',
  `CITY` varchar(10) DEFAULT NULL COMMENT '地市',
  `DISTRICT` varchar(10) DEFAULT NULL COMMENT '区县',
  `DEPARTMENT` varchar(50) DEFAULT NULL COMMENT '部门',
  `CHANNEL` varchar(50) DEFAULT NULL COMMENT '渠道名称',
  `PROD_ID` int(11) DEFAULT NULL COMMENT '产品ID',
  `PROD_TYPE` varchar(50) DEFAULT NULL COMMENT '产品类别',
  `PROD_NAME` varchar(50) DEFAULT NULL COMMENT '产品名称',
  `COMBO_FEE` decimal(10,2) DEFAULT NULL COMMENT '套餐月费',
  `PROMISE_TIME` int(11) DEFAULT NULL COMMENT '承诺在网时长',
  `PRE_PAY_FEE` decimal(10,2) DEFAULT NULL COMMENT '预存款',
  `CUSTID` int(11) DEFAULT NULL COMMENT '客户ID',
  `REALNAMETYPE` int(11) DEFAULT NULL COMMENT '客户实名标识',
  `CUSTTYPE` int(11) DEFAULT NULL COMMENT '新老客户标识',
  `REFCUSTID` int(11) DEFAULT NULL COMMENT '老客户ID',
  `CERTTYPE` int(11) DEFAULT NULL COMMENT '证件类型',
  `CERTNUM` varchar(50) DEFAULT NULL COMMENT '证件号码',
  `CERTADRESS` varchar(512) DEFAULT NULL COMMENT '证件地址',
  `CUSTOMERNAME` varchar(50) DEFAULT NULL COMMENT '客户名称',
  `SEX` varchar(10) DEFAULT NULL COMMENT '性别',
  `TMPPHONE` varchar(50) DEFAULT NULL COMMENT '电话',
  `CUSTTYPE1` varchar(50) DEFAULT NULL COMMENT '客户类型',
  `PSPTNUMBER` varchar(50) DEFAULT NULL COMMENT '港澳台居民出入境证件证件号码',
  `SERIAL_ID` int(11) DEFAULT NULL COMMENT '业务编码',
  `SERIAL_NUMBER` varchar(50) DEFAULT NULL COMMENT '手机号码',
  `SERIAL_PROVINCE` varchar(10) DEFAULT NULL COMMENT '归属省分',
  `SERIAL_CITY` varchar(10) DEFAULT NULL COMMENT '归属地市',
  `BUSINESS_TYPE` varchar(50) DEFAULT NULL COMMENT '业务分类',
  `ADVANCE_LIMIT` decimal(10,2) DEFAULT NULL COMMENT '预存款（分）',
  `MONTHFEE_LIMIT` decimal(10,2) DEFAULT NULL COMMENT '月承诺通信费（分）',
  `MONTH_LIMIT` int(11) DEFAULT NULL COMMENT '协议期（月）',
  `NICE_RULE_TAG` int(11) DEFAULT NULL COMMENT '靓号标志位',
  `FEATURE_TYPE` varchar(50) DEFAULT NULL COMMENT '特色靓号类型',
  `FEATURE_NAME` varchar(50) DEFAULT NULL COMMENT '特色靓号名',
  `GOOD_TYPE` varchar(50) DEFAULT NULL COMMENT '靓号类型',
  `PAYINFO` varchar(50) DEFAULT NULL COMMENT '支付信息',
  `PAYTYPE` varchar(50) DEFAULT NULL COMMENT '支付方式',
  `PAYORG` varchar(50) DEFAULT NULL COMMENT '支付机构名称',
  `PAYNUM` varchar(50) DEFAULT NULL COMMENT '支付账号',
  `SALEPRICE` decimal(10,2) DEFAULT NULL COMMENT '销售价格（单位：厘）',
  `COST` decimal(10,2) DEFAULT NULL COMMENT '成本价格（单位：厘）',
  `CARDPRICE` decimal(10,2) DEFAULT NULL COMMENT '卡费（单位：厘）',
  `RESERVAPRICE` decimal(10,2) DEFAULT NULL COMMENT '预存话费金额（单位：厘）',
  `RESOURCESBRANDCODE` varchar(50) DEFAULT NULL COMMENT '品牌',
  `ORGDEVICEBRANDCODE` varchar(50) DEFAULT NULL COMMENT '3GESS维护品牌',
  `RESOURCESBRANDNAME` varchar(50) DEFAULT NULL COMMENT '终端品牌名称',
  `RESOURCESMODELCODE` varchar(50) DEFAULT NULL COMMENT '型号',
  `RESOURCESMODELNAME` varchar(50) DEFAULT NULL COMMENT '终端型号名称',
  `RESOURCESSRCCODE` varchar(50) DEFAULT NULL COMMENT '终端来源编码',
  `RESOURCESSRCNAME` varchar(50) DEFAULT NULL COMMENT '终端来源名称',
  `RESOURCESSUPPLYCORP` varchar(50) DEFAULT NULL COMMENT '终端供货商名称',
  `RESOURCESSERVICECORP` varchar(50) DEFAULT NULL COMMENT '终端服务商名称',
  `RESOURCESCOLOR` varchar(10) DEFAULT NULL COMMENT '终端颜色',
  `MACHINETYPECODE` varchar(50) DEFAULT NULL COMMENT '终端机型编码',
  `MACHINETYPENAME` varchar(50) DEFAULT NULL COMMENT '终端机型名称',
  `TERMINALTYPE` varchar(10) DEFAULT NULL COMMENT '终端类别编码',
  `TERMINALTSUBTYPE` varchar(50) DEFAULT NULL COMMENT '终端子类别编码',
  `SIMID` int(11) DEFAULT NULL COMMENT 'SIMID',
  `IMSI` varchar(50) DEFAULT NULL COMMENT '新IMSI号',
  PRIMARY KEY (`ACCOUNT_HAND_APPLY_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='开户信息表';

/*Data for the table `account_hand_apply` */

/*Table structure for table `busi_order` */

DROP TABLE IF EXISTS `busi_order`;

CREATE TABLE `busi_order` (
  `BUSI_CELLNO` int(11) NOT NULL AUTO_INCREMENT COMMENT '办理业务号码',
  `BUSI_ORDER_DATE` datetime DEFAULT NULL COMMENT '业务系统订单日期',
  `PROVINCE_CODE` varchar(10) DEFAULT NULL COMMENT '省分',
  `EPARCHY_CODE` varchar(10) DEFAULT NULL COMMENT '地市',
  `CITY_CODE` varchar(10) DEFAULT NULL COMMENT '区县',
  `CHANNEL_ID` varchar(50) DEFAULT NULL COMMENT '渠道',
  `OPER_ID` int(11) DEFAULT NULL COMMENT '操作员ID',
  `BUSI_ORDER_ID` varchar(50) DEFAULT NULL COMMENT '业务系统支付订单号',
  `SIGNATURE` varchar(50) DEFAULT NULL COMMENT '接口签名',
  `SIGNATURE_TYPE` varchar(50) DEFAULT NULL COMMENT '签名方式',
  `BUSI_TRANS_TYPE` varchar(50) DEFAULT NULL COMMENT '交易类型',
  `BUSI_MERC_ID` varchar(50) DEFAULT NULL COMMENT '合作商户名称',
  `BUSI_AMT` decimal(10,2) DEFAULT NULL COMMENT '订单金额（单位:分）',
  `CUSTID` int(11) DEFAULT NULL COMMENT '客户ID',
  `SERIAL_ID` int(11) DEFAULT NULL COMMENT '号码ID',
  `PROD_ID` int(11) DEFAULT NULL COMMENT '产品ID',
  `PAYINFO` varchar(50) DEFAULT NULL COMMENT '支付信息',
  `PAYTYPE` varchar(50) DEFAULT NULL COMMENT '支付方式',
  `PAYORG` varchar(50) DEFAULT NULL COMMENT '支付机构名称',
  `PAYNUM` varchar(50) DEFAULT NULL COMMENT '支付账号',
  `pay_flag` int(11) DEFAULT NULL COMMENT '成功标志',
  PRIMARY KEY (`BUSI_CELLNO`),
  UNIQUE KEY `SERIAL_ID_UNIQUE` (`SERIAL_ID`)
