/*Table structure for table `customer` */

DROP TABLE IF EXISTS `customer`;

CREATE TABLE `customer` (
  `CUSTID` int(11) NOT NULL AUTO_INCREMENT COMMENT '客户ID',
  `REALNAMETYPE` int(11) DEFAULT NULL COMMENT '客户实名标识',
  `CUSTTYPE` int(11) DEFAULT NULL COMMENT '新老客户标识',
  `REFCUSTID` int(11) DEFAULT NULL COMMENT '老客户ID',
  `CERTTYPE` int(11) DEFAULT NULL COMMENT '证件类型',
  `CERTNUM` varchar(50) DEFAULT NULL COMMENT '证件号码',
  `CERTADRESS` varchar(512) DEFAULT NULL COMMENT '证件地址',
  `CUSTOMERNAME` varchar(50) DEFAULT NULL COMMENT '客户名称',
  `CERTEXPIREDATE` datetime DEFAULT NULL COMMENT '证件失效日期',
  `SEX` varchar(10) DEFAULT NULL COMMENT '性别',
  `TMPPHONE` varchar(50) DEFAULT NULL COMMENT '电话',
  `CONTACTPERSON` varchar(50) DEFAULT NULL COMMENT '联系人',
  `CONTACTPHONE` varchar(50) DEFAULT NULL COMMENT '联系人电话',
  `CONTACTADDRESS` varchar(512) DEFAULT NULL COMMENT '联系地址',
  `CUSTTYPE1` varchar(50) DEFAULT NULL COMMENT '客户类型',
  `ISSUESNUMBER` int(11) DEFAULT NULL COMMENT '港澳台居民出入境证件签发次数',
  `PSPTAUTHORITY` varchar(50) DEFAULT NULL COMMENT '港澳台居民出入境证件签发机关',
  `PSPTSTARTDATE` datetime DEFAULT NULL COMMENT '港澳台居民出入境证件证件起始有效期',
  `PSPTNUMBER` varchar(512) DEFAULT NULL COMMENT '港澳台居民出入境证件证件号码',
  `CUSTOMERREMARK` varchar(512) DEFAULT NULL COMMENT '客户备注',
  PRIMARY KEY (`CUSTID`)
) ENGINE=InnoDB AUTO_INCREMENT=2075 DEFAULT CHARSET=utf8 COMMENT='客户信息表';

